                "creation_description": "Chapter 374: After arriving back in town she would be waiting for me. My best friend... Aurelia... Your relative Ada. She was a sweet woman. Full of life and love. Always knew how to put a smile on people. Me included. \"Once again I have proven to be the fast woman of all of town. Bow before your new ruler.\" \"Sure thing your grace and I must say your rags look like the riches of all of town!\" \"Very funny Amber.\" \"Ah but I am your jester after all.\" We both laughed. \"How was your delivery?\" \"It wasn't bad. The good doctor needed a break and said I arrived at the perfect time. How was the  Tailor?\" \"Not doing well. Two of his workers were killed the other day.\" \"Oh my... That sounds awful.\" \"It was. He wanted me to leave quickly since he didn't want me in the woods before dark.\" \"I wouldn't either. The woods are a scary place.\" \"Not for me it isn't. I find comfort for some reason.\" \"Wanna see the stars tonight?\" \"Of course.\" (Seeing Stars feat. Lotus Juice - Mori Calliope)",
